pragma solidity ^0.8.0;
contract Lottery{
    address public owner;
    address[] public participants;
    uint256 starttime;

    address public winner;


    constructor(){
        owner = msg.sender;
        starttime = block.timestamp;
        //console.log("owner baddress",owner); 
    }

    function tellOwner() public returns(address ownera){
        return owner;
    }
    modifier shouldOwner(){

        require(msg.sender==owner);
        _;
    }
    modifier validTime(){
        require(block.timestamp<=starttime+60 minutes);
        _;
    }

    modifier partfee(){
        require(msg.value == 0.1 ether);
        _;
    }
    modifier announcetime(){
        require(block.timestamp>starttime+60 minutes);
        _;
    }

    function registerParticipants() public payable partfee validTime {
        participants.push(msg.sender);
    }

    function announceWinner() private announcetime shouldOwner{

        winner = participants[1];

    }   
}

